import React from 'react'
import {Row,Col} from 'reactstrap';
import "bootstrap/dist/css/bootstrap.min.css";
import Football from"./Images/football.jpeg";



function Component_2() {


  return (
    <div>
        <Container>
        <img src={Football}  />
        </Container>
       

    </div>
  )
}

export default Component_2
